var getUrlStringFromDate = function (date) {
    var time = [date.getUTCHours(), date.getUTCMinutes()];
    return time;
};

var mainLoop = function () {
    var date = new Date();

    var hourHand = parcel.getFeatureById('hourHand');
    var minuteHand = parcel.getFeatureById('minuteHand');

    time = getUrlStringFromDate(date);

    hourHand.rotation.x = Math.PI * (time[0] / 6 + time[1] / 360);
    minuteHand.rotation.x = Math.PI * time[1] / 30;

    setTimeout(mainLoop, 30000);
};

mainLoop();

